import "./home-style.css";

import Header from '../Header/header';
import Footer from '../Footer/footer';

const Home = () => {
    return(
        <main classNam="main">
            <Header/>
            <div className='banner_principal'>
                <h1>Greeng Store</h1>
                <h3>A sua loja de Tecnologia</h3>
            </div>
            <div className='introducao'>
                <h3>Principais marcas</h3>
            </div>
            <Footer/>
        </main>
    );
}

export default Home;
